import React from 'react';
import { NavLink } from 'react-router-dom';

const Error = () => {
    return (
        <>
            <div className="setStyle2">
                <h1> Error 404 </h1>
                <p> Could not found page </p>
                <NavLink to="/" >Go Back</NavLink>
            </div>
        </>
    );
}

export default Error;
